import React from 'react';

const Frame6a24 = () => {
  return (
    <div
      style={{
        width: '253px',
        height: '240px',
        display: 'flex',
        flexDirection: 'column',
        gap: '8px',
        paddingLeft: '20px',
        paddingRight: '20px',
        boxSizing: 'border-box',
        borderLeft: '0.5px dashed rgba(238,66,55,1)',
      }}
    >
      {/* Frame6a24 content goes here */}
      <div style={{ height: '89.69px' }} />
      <div
        style={{
          width: '249px',
          height: '28px',
          color: 'rgba(28,38,76,1)',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '22px',
          lineHeight: '28px',
          letterSpacing: '-0.05em',
        }}
      >
        Safe and Reliable Trucks
      </div>
    </div>
  );
};

export default Frame6a24;
